import React from "react";

import styled from "styled-components";
import Skillheader from "../04 Organisms/skillpage/skillheader";
import {colorsRoles} from "../01 Atoms/Colors";
import {media} from "../01 Atoms/MediaQueries";

import {images} from "../01 Atoms/Images";
import TemplateMethodo from "../04 Organisms/skillpage/TemplateMethodo";
import {ClientsUXUI} from "../01 Atoms/Data";



export const Box = styled.div`
position: relative;
${media.desktop`
margin-right: 80px;
`
}

`;

export const Placeholder = styled.div`
color: white;
    font-size: 4em;
`;

export const Iframe = styled.iframe`
width:500px; 
height:500px; 
border:0; 
border-radius: 4px; 
overflow:hidden;"
`;

const CreativeDeveloperProjects = () => {
    return <>

        <Box>


            <Skillheader
                mainTitle={"Creative Developer"}
                mainColor={colorsRoles.Brand02}
                srcMainImg={images.Fox}
                description={"Description 01"}
                Flipped={true}

            />
            <TemplateMethodo iscreativedeveloper/>

            <Placeholder>

            </Placeholder>
            <Iframe src="https://codesandbox.io/embed/button-component-02ecz?fontsize=14&hidenavigation=1&theme=dark&view=preview"
                    title="Button Component"
                    allow="accelerometer; ambient-light-sensor; camera; encrypted-media; geolocation; gyroscope; hid; microphone; midi; payment; usb; vr; xr-spatial-tracking"
                    sandbox="allow-forms allow-modals allow-popups allow-presentation allow-same-origin allow-scripts"
            ></Iframe>


        </Box>

    </>

};


export default CreativeDeveloperProjects;
